sys_variable_value.value:
(function execute(inputs, outputs) {
  var responseObj = JSON.parse(inputs.response);
  outputs.permission_targets = [];
  for (var i = 0; i < responseObj.length; i++) {
    outputs.permission_targets[i] = {};
    outputs.permission_targets[i].name = responseObj[i].name;
    outputs.permission_targets[i].uri = responseObj[i].uri;
  }
})(inputs, outputs);

